import Header from "./Header";

function App() {
  return (
    <div className="bg-gray-200 h-full py-16">
      <div className="w-9/12 mx-auto">
        <Header />
        <div className="flex gap-x-6 text-gray-700 text-xl uppercase">
          <span className="cursor-pointer">Activity</span>
          <span className="cursor-pointer">Information</span>
        </div>
        <hr className="bg-gray-500 text-black h-1 mt-5 w-full" />
      </div>
    </div>
  );
}

export default App;
